$(function() {
    (function(i){var e=/iPhone/i,n=/iPod/i,o=/iPad/i,t=/(?=.*\bAndroid\b)(?=.*\bMobile\b)/i,r=/Android/i,d=/BlackBerry/i,s=/Opera Mini/i,a=/IEMobile/i,b=/(?=.*\bFirefox\b)(?=.*\bMobile\b)/i,h=RegExp("(?:Nexus 7|BNTV250|Kindle Fire|Silk|GT-P1000)","i"),c=function(i,e){return i.test(e)},l=function(i){var l=i||navigator.userAgent;this.apple={phone:c(e,l),ipod:c(n,l),tablet:c(o,l),device:c(e,l)||c(n,l)||c(o,l)},this.android={phone:c(t,l),tablet:!c(t,l)&&c(r,l),device:c(t,l)||c(r,l)},this.other={blackberry:c(d,l),opera:c(s,l),windows:c(a,l),firefox:c(b,l),device:c(d,l)||c(s,l)||c(a,l)||c(b,l)},this.seven_inch=c(h,l),this.any=this.apple.device||this.android.device||this.other.device||this.seven_inch},v=i.isMobile=new l;v.Class=l})(window);

    if (isMobile.any) {
        $("head").append("<link href='http://cdn.jsdelivr.net/drozdov-ai-phone-call/1.0/widget.css' type='text/css' rel='stylesheet' />");
        $('<img class="ai-hbeat" style="width: 56px;height: 57px;" src="data:image/png;base64,"/>')
            .appendTo('body');

        $('<div class="ai-phone-menu">'
             +'<div class="ai-menu-item"><a href="tel:88002000000">Бесплатная консультация</a></div>'
             +'<div class="ai-menu-item"><a href="tel:88002000000">Поддержка клиентов</a></div>'
          +'</div>').appendTo('body');

        $('<div class="ai-overlay"></div>').prependTo('body');


        var img = $('.ai-hbeat').show();
        function positionImg() {
            var left = $('body').width() / 2 - 28;
            img.css('left', left);
        }

        positionImg();
        $(window).resize(positionImg);

        function pulse() {
            img.animate({
                width: 56, height: 57,
                opacity: 0.7
            }, 700, function() {
                img.animate({
                    width: 61, height: 62,
                    opacity: 0.8
                }, 700, function() {
                    pulse();
                });
            });
        }
        pulse();


        img.click(function(){
            $(this).hide().stop();
            $('.ai-overlay').fadeIn('fast');
            $('.ai-phone-menu').show().animate({
                bottom: 0
            }, 200);
        });

        $('.ai-overlay').click(function(){
            $('.ai-overlay').fadeOut('fast');
            $('.ai-phone-menu').animate({
                bottom: -125
            }, 200, function(){
                $(this).hide();
                img.show();
                pulse();
            });
        });
    }
});
